  `adharcard` mediumtext,
  `pancard` mediumtext
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `admin` */

/*Table structure for table `admindetails` */

DROP TABLE IF EXISTS `admindetails`;

CREATE TABLE `admindetails` (
  `id` int(11) DEFAULT NULL,
  `NAME` varchar(25) DEFAULT NULL,
  `surName` varchar(26) DEFAULT NULL,
  `email` varchar(40) DEFAULT NULL,
  `address` varchar(40) DEFAULT NULL,
  `mobileNo` int(11) DEFAULT NULL,
  `gender` varchar(35) DEFAULT NULL,
  `PASSWORD` varchar(20) DEFAULT NULL,
  `adharcard` mediumtext,
  `pancard` mediumtext,
  `language` varchar(50) DEFAULT NULL,
  `dob` date DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `admindetails` */

/*Table structure for table `apartmentdetails` */

DROP TABLE IF EXISTS `apartmentdetails`;

