/*Table structure for table `ownerdetails` */

DROP TABLE IF EXISTS `ownerdetails`;

CREATE TABLE `ownerdetails` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `NAME` varchar(25) DEFAULT NULL,
  `surName` varchar(26) DEFAULT NULL,
  `email` varchar(40) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `address` varchar(40) DEFAULT NULL,
  `mobileNo` int(11) DEFAULT NULL,
  `gender` varchar(35) DEFAULT NULL,
  `PASSWORD` varchar(20) DEFAULT NULL,
  `adharcard` mediumtext,
  `pancard` mediumtext,
  `dob` date DEFAULT NULL,
  `language` varchar(40) DEFAULT NULL,
  `ownerProfile` blob,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

