/*Table structure for table `tenantdetails` */

DROP TABLE IF EXISTS `tenantdetails`;

CREATE TABLE `tenantdetails` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tenantName` varchar(45) DEFAULT NULL,
  `surName` varchar(40) DEFAULT NULL,
  `email` varchar(45) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `address` varchar(45) DEFAULT NULL,
  `mobileNo` mediumtext,
  `workName` varchar(45) DEFAULT NULL,
  `PASSWORD` varchar(30) DEFAULT NULL,
  `image` longblob,
  `ownerId` mediumtext,
  `Gender` char(1) DEFAULT NULL,
  `adharCard` mediumtext,
  `panCard` char(20) DEFAULT NULL,
  `flateNo` int(40) DEFAULT NULL,
  `florNo` int(30) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

